import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from './atoms/Button';
import Image from './atoms/Image';
function App() {
  const click=()=>{
    console.log('item clicked')
  }
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      <Button text={'hello world'} height={40} width={130} rounded={true} onclick={click}/>
      <br />
      <Button text={'Primary'} height={50} width={130} rounded={true} onclick={click} textcolor='black' backgroundcolor='#50C5B7'/>
      <br />
      <Button text={'Secondary'} height={50} width={130} rounded={true} onclick={click} textcolor='white' backgroundcolor='#096B72'/>
      <br />
      <Image href='https://picsum.photos/200/300' height={200} width={200}/>
      </header>
    </div>
  );
}

export default App;
